                    ctx.beginPath();
                    ctx.arc(start[0], start[1], 8, 0, 2*Math.PI);
                    ctx.fillStyle = '#27ae60';
                    ctx.fill();
                    ctx.strokeStyle = 'white';
                    ctx.lineWidth = 2;
                    ctx.stroke();
                    
                    ctx.beginPath();
                    ctx.arc(end[0], end[1], 8, 0, 2*Math.PI);
                    ctx.fillStyle = '#9b59b6';
                    ctx.fill();
                    ctx.strokeStyle = 'white';
                    ctx.lineWidth = 2;
                    ctx.stroke();
                }
            }
            
            // Draw axis labels
            ctx.fillStyle = '#333';
            ctx.font = '11px Arial';
            ctx.fillText('46.5¬∞E', padding, canvas.height - 10);
            ctx.fillText('47.0¬∞E', canvas.width - padding - 30, canvas.height - 10);
            ctx.fillText('24.5¬∞N', 5, canvas.height - padding);
            ctx.fillText('25.0¬∞N', 5, padding + 10);
        }
        
        function selectTrip(idx) {
            currentTrip = idx;
            document.getElementById('showTrip').checked = true;
            document.querySelectorAll('.trip-btn').forEach((b, i) => b.classList.toggle('active', i === idx));
            draw();
        }
        
        // Build trip buttons
        var container = document.getElementById('trips');
        trips.forEach((t, i) => {
            var btn = document.createElement('button');
            btn.className = 'trip-btn';
            btn.onclick = () => selectTrip(i);
            btn.innerHTML = 'Trip ' + t.id;
            container.appendChild(btn);
        });
        
        draw();
    </script>
</body>
</html>
